import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom';
import { fetchActivities, signUp, signIn, createActivity, fetchRoutinesByUser, 
         editActivity, fetchRoutineActivities, fetchRoutines, createRoutine, 
         editRoutine, deleteRoutine, createRoutineActivity, editRoutineActivity, deleteRoutineActivity } from './api';

import  NavBar from './components/NavBar';  
import Routes from './components/Routes'; 

import { BrowserRouter as Router, Route } from "react-router-dom";

const App = () => {
  signUp('poildecarotte1', 'testing01')
  signIn()
  fetchActivities()
  createActivity()
  fetchRoutinesByUser()
  editActivity()
  fetchRoutineActivities()
  fetchRoutines()
  createRoutine()
  editRoutine()
  deleteRoutine()
  createRoutineActivity()
  editRoutineActivity()
  deleteRoutineActivity()
  return (
    <div id="App">
      <NavBar />
      <Routes />
    </div>
  );
}

ReactDOM.render(
  <Router>
    <App />
  </Router>,
  document.getElementById('root')
);
